description:
Steve Jobs: Billion Dollar Hippy

Technology Documentary hosted by Evan Davis, published by BBC broadcasted as part of BBC The Money Programme series in 2011 - English narration


Information
------------------------------

Documentary looking at Apple - one of the biggest corporations in the world, fuelled by game-changing products that tap into modern desires, and its leader Steve Jobs, who contributed to its success by fusing a Californian counterculture attitude and a mastery of the art of hype with explosive advances in computer technology. Insiders including Apple co-founder Steve Wozniak, the chairman who ousted Jobs from the company he founded, and Jobs' chief of software, tell extraordinary stories of the rise, fall and rise again of Apple with Steve Jobs at its helm. With Stephen Fry, world wide web inventor Sir Tim Berners-Lee and branding guru Rita Clifton, Evan Davis decodes the formula that took Apple from suburban garage to global supremacy.

